import styled from 'styled-components'

export const RatingStars = styled.div`
  display: flex;
`

export const RatingStarWrapper = styled.div`
  position: relative;
  margin-right: 1px;
  svg {
    width: 1rem;
    height: 1rem;
    fill: currentColor;
    position: absolute;
    display: inline-block;
  }
`

export const RatingStarPercent = styled.div`
  svg {
    color: #ffce3d;
  }
`
